    <style>
      @font-face{font-family:'FONT2';src:url('/data/fonts/Tempura.ttf');}
      *{margin:0;padding:0;overflow:hidden}
      #fram{width:100vw;height:100vh;z-index:99;border:none}
      body{top:50%;font-family:'FONT2',sans-serif;text-align:center;background:url('/data/images/loading.gif') no-repeat;transition:.5s}
      a{color:inherit;text-decoration:none}
      .navbar{display:flex;flex-wrap:wrap;flex-direction:row;width:30vw;height:22px;border-radius:3px;padding:.9%;position:fixed;top:5.5vh;z-index:10000;left:50%;background:#100520;text-align:center;align-content:space-evenly;align-items:center;transform:translate(-50%,-4vh)}
      .navbar-enclosure{text-align:center;display:flex;justify-content:space-evenly}
      .top-spot{display:flex;width:500px;height:22px;border-radius:5px;padding:9px;position:fixed;top:5.5vh;z-index:10000;left:50%;background:rgba(153,50,204,.1);border:2px solid darkorchid;text-align:center;align-content:space-evenly;align-items:center;transform:translate(-50%,-4vh)}
      .top-spot-enclosure{text-align:center;position:absolute;left:50%;transform:translate(-50%,0);display:flex}
      .buttin{height:26px;margin-left:.4vw;margin-right:.4vw;cursor:pointer;justify-content:space-evenly;transition:.3s;padding:5px}
      .buttin img{width:26px;display:inline-flex;margin-left:-6px;margin-right:-6px;height:auto;transition:1s;}
      .buttin #svgg{filter: invert(100%) sepia(4%) saturate(0%) hue-rotate(293deg) brightness(107%) contrast(104%);}
      .buttin p{vertical-align:top;display:inline-flex;will-change:auto;margin:0;margin-right:1px}
      button{appearance:none;background-color:#000;border:.125em solid #1A1A1A;border-radius:.9375em;box-sizing:border-box;color:#fff;cursor:pointer;display:inline-block;line-height:normal;min-height:3.75em;min-width:48%;outline:none;margin-left:1%;margin-bottom:2%;padding:1em 2.3em;text-align:center;text-decoration:none;user-select:none}
      .slashapp{align-items:center;text-align:center;margin-bottom:8px}
      .slashapp_{font-family:'FONT2',sans-serif;font-size:16px;border:none;background-color:#000;color:white;padding:.7rem 1rem;border-radius:3px;width:8.8vw;height:24px;opacity:.3;text-align:center}
      .slashapp_:focus{outline:none}
      .transitionedtopbar{transition:.3s ease-in-out}
      #customCloakinput{display:none}
    </style>
</head>

          <a onclick="fsFram()"><div class="buttin"><img id="svgg" style="margin-top: 5px;" src="/data/images/svg/fullscreen.svg" /></div></a>
          <a onclick="ntFram()"><div class="buttin"><img id="svgg" style="margin-top: 5px;" src="/data/images/svg/newtab.svg" /></div></a>

      </div>
